import React from "react";
import {
    Navbar,
    NavbarBrand,
    NavbarNav,
    NavItem,
    NavLink,
    NavbarToggler,
    Collapse,
    FormInline,
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem
} from "mdbreact";

export default class NavbarPage extends React.Component {
    state = {
        isOpen: false
    };

    toggleCollapse = this.setState({ isOpen: !this.state.isOpen });

    render() {
        return (
            <Navbar color="indigo" dark expand="md">
                <p>Hello</p>
            </Navbar>
        );
    }
}
